import React from "react";
import "./Skill.css";
import Web from "../../img/web.png";
import Arch from "../../img/arch.png";
import Design from "../../img/design.png";
import Card from "../Card/Card";

const Skill = () => {
  return (
    <div className="skill">
      <div className="technical">
        <span>My Technical</span>
        <span>Skills</span>
        <span>
          Expertise in object-oriented programming, developing, and testing.
          <br />
          Experience in full-stack Web/Mobile development.
          <br />
          Proficient in computational design and UX design in A/E industry.
        </span>
        <button className="button s-button">Download CV</button>
        <div className="blur s-blur1" style={{ background: "#ABF1FF94" }}></div>
      </div>
      <div className="cards">
        <div style={{ left: "14rem" }}>
          <Card
            emoji={Web}
            heading={"Developer"}
            detail={
              "Java, Python, C/C++, JavaScript, HTML/CSS, MySQL, MongoDB, AWS, GIT, React, Spring Boot..."
            }
          />
        </div>
        <div style={{ top: "12rem", left: "-4rem" }}>
          <Card
            emoji={Design}
            heading={"Design"}
            detail={
              "Sketch, Adobe PhotoShop, Adobe Illustractor, Adobe Indesign..."
            }
          />
        </div>
        <div style={{ top: "19rem", left: "12rem" }}>
          <Card
            emoji={Design}
            heading={"Design"}
            detail={
              "Sketch, Adobe PhotoShop, Adobe Illustractor, Adobe Indesign..."
            }
          />
        </div>
      </div>
    </div>
  );
};

export default Skill;
